import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MarsRoverPhotos = () => {
  const [photos, setPhotos] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [rover, setRover] = useState('curiosity');
  const [camera, setCamera] = useState('navcam');
  const [sol, setSol] = useState(1000);
  const [page, setPage] = useState(1);

  const fetchPhotos = async () => {
    setLoading(true);
    setError('');
    
    try {
      const response = await axios.get(`http://localhost:5000/api/mars-rover-photos`, {
        params: { rover, camera, sol, page }
      });

      console.log('API Response:', response.data);
      setPhotos(response.data.photos || []);
    } catch (error) {
      console.error('Error fetching Mars Rover photos:', error);
      setError('Failed to load Mars Rover photos. Try again.');
    }

    setLoading(false);
  };

  useEffect(() => {
    fetchPhotos();
  }, []); // Fetch photos on first load

  return (
    <div style={{ textAlign: 'center', padding: '20px' }}>
      <h1>Mars Rover Photos</h1>

      {/* Dropdowns for user input */}
      <div style={{ marginBottom: '20px' }}>
        <label>Rover: </label>
        <select value={rover} onChange={(e) => setRover(e.target.value)}>
          <option value="curiosity">Curiosity</option>
          <option value="opportunity">Opportunity</option>
          <option value="spirit">Spirit</option>
        </select>

        <label style={{ marginLeft: '10px' }}>Camera: </label>
        <select value={camera} onChange={(e) => setCamera(e.target.value)}>
          <option value="navcam">NavCam</option>
          <option value="fhaz">Front Hazard Camera</option>
          <option value="rhaz">Rear Hazard Camera</option>
        </select>

        <label style={{ marginLeft: '10px' }}>Sol: </label>
        <input
          type="number"
          value={sol}
          onChange={(e) => setSol(e.target.value)}
          style={{ width: '80px' }}
        />

        <label style={{ marginLeft: '10px' }}>Page: </label>
        <input
          type="number"
          value={page}
          onChange={(e) => setPage(e.target.value)}
          style={{ width: '50px' }}
        />

        <button onClick={fetchPhotos} style={{ marginLeft: '10px', padding: '5px 10px', cursor: 'pointer' }}>
          Fetch Photos
        </button>
      </div>

      {loading && <p>Loading photos...</p>}
      {error && <p style={{ color: 'red' }}>{error}</p>}

      {/* Display photos */}
      <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
        {photos.length > 0 ? (
          photos.map((photo) => (
            <img key={photo.id} src={photo.img_src} alt={`Mars Rover ${photo.id}`} style={{ width: '200px', margin: '10px' }} />
          ))
        ) : (
          !loading && <p>No photos found. Try different settings.</p>
        )}
      </div>
    </div>
  );
};

export default MarsRoverPhotos;
